import React from 'react';
import { useSelector, useDispatch } from 'react-redux'; // Importamos useSelector y useDispatch

const Counter = () => {
  const count = useSelector((state) => state.count); // Obtenemos el estado "count" desde Redux
  const dispatch = useDispatch(); // Obtenemos el dispatcher de Redux

  const increment = () => {
    // Despachamos la acción "INCREMENT" al hacer clic en el botón
    dispatch({ type: 'INCREMENT' });
  };

  const decrement = () => {
    // Despachamos la acción "DECREMENT" al hacer clic en el botón
    dispatch({ type: 'DECREMENT' });
  };

  return (
    <div>
      <h2>Contador: {count}</h2>
      <button onClick={increment}>Incrementar</button>
      <button onClick={decrement}>Decrementar</button>
    </div>
  );
};

export default Counter;
